import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './pages/Home';
import Dashboard from './pages/Dashboard';
import MovieWatchlist from './pages/MovieWatchlist';
import AddMovie from './pages/AddMovie';
import EditMovie from './pages/EditMovie';
import MovieDetails from './pages/MovieDetails';
import UserProfile from './pages/UserProfile';
import AdminDashboard from './pages/AdminDashboard';
import Search from './pages/Search';
import NotFound from './pages/NotFound';
import Login from './pages/Login';
import SignUp from './pages/SignUp';
import Logout from './pages/Logout';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/moviewatchlist" element={<MovieWatchlist />} /> {/* Ensure this path matches the link */}
        <Route path="/add-movie" element={<AddMovie />} />
        <Route path="/edit-movie" element={<EditMovie />} />
        <Route path="/movie-details" element={<MovieDetails />} />
        <Route path="/profile" element={<UserProfile />} />
        <Route path="/admin" element={<AdminDashboard />} />
        <Route path="/search/:id" element={<Search />} /> // Updated route
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<SignUp />} />
        <Route path="/logout" element={<Logout />} />
        <Route path="*" element={<NotFound />} /> {/* Catch-all route for 404 pages */}
      </Routes>
    </Router>
  );
}

export default App;
